import React from 'react'
import "./List.css"

const ListItem = (props) => {
  return (
      <>
      <div>
     <li>
      {props.text}
    </li>
      </div>
      <div className="btn">
           <button className='add-button' >A</button>
           </div>
      </>
  )
}

export default ListItem;
